    "afsc-nmml-ccep-diet-of-pacific-harbor-seals-at-umpqua-river-oregon-and-columbia-river-oreg-2005",nt"isopen":
    false,nt"url": null,nt"notes": "From 1994 to 2005, The National Marine
    Mammal Laboratories' California Current Ecosystem Program (AFSC/NOAA) collected
    fecal samples at the Umpqua River, Oregon and Columbia River, Oregon/Washington
    to examine the diet of Pacific harbor seals (Phoca vitulina). Scats were collected
    at various sites on the Umpqua River and at Desdemona sand spit on the Columbia
    River. Apart from describing the diet of Pacific harbor seals in these regions,
    of special interest was to determine the level of predation by these seals on endangered
    or threatened salmonids (e.g. cutthroat trout; Oncorhyncus clarkii).",nt"license_title":
